import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';
import { NgConnectModule } from 'app/ng-connect';

@NgModule({
  imports: [
    NgConnectModule,
    RouterModule.forChild([
      {
        path: 'acm',
        loadChildren: () => import('app/admin/access-control/access-control.module').then(m => m.IcAccessControlModule),
        data: {
          pageTitle: 'acmAdmin.home.title',
        },
      },
      {
        path: 'audits',
        loadChildren: () => import('./audits/audits.module').then(m => m.AuditsModule),
      },
      {
        path: 'configuration',
        loadChildren: () => import('./configuration/configuration.module').then(m => m.ConfigurationModule),
      },
      {
        path: 'docs',
        loadChildren: () => import('./docs/docs.module').then(m => m.DocsModule),
      },
      {
        path: 'logs',
        loadChildren: () => import('./logs/logs.module').then(m => m.LogsModule),
      },
      {
        path: 'metrics',
        loadChildren: () => import('./metrics/metrics.module').then(m => m.MetricsModule),
      },
      {
        path: 'ic-entityaudit',
        loadChildren: () => import('app/admin/entity-audit/entityaudit.module').then(m => m.EntityAuditModule),
      },
      {
        path: 'ic-codetype',
        loadChildren: () => import('app/admin/code-admin/code-admin.module').then(m => m.IcCodeAdminModule),
      },
      {
        path: 'ic-code',
        loadChildren: () => import('app/admin/code-admin/code/code.module').then(m => m.CodeModule),
      },
      {
        path: 'ic-param',
        loadChildren: () => import('app/admin/param-admin/param-admin.module').then(m => m.ConnectParamAdminModule),
      },
      {
        path: 'reportTemplate',
        loadChildren: () => import('app/admin/report/report-template/template.module').then(m => m.TemplateModule),
      },
      {
        path: 'job-instance',
        loadChildren: () => import('app/admin/batch/job-instance/job-instance.module').then(m => m.JobWebJobInstanceModule),
      },
      {
        path: 'job-execution',
        loadChildren: () => import('app/admin/batch/job-execution/job-execution.module').then(m => m.JobWebJobExecutionModule),
      },
      {
        path: 'ic-email-template',
        loadChildren: () => import('app/admin/email-template/email-template.module').then(m => m.EmailTemplateModule),
      },
      {
        path: 'schedule',
        loadChildren: () => import('app/admin/schedule/schedule.module').then(m => m.ScheduleModule),
      },
      {
        path: 'health',
        loadChildren: () => import('./health/health.module').then(m => m.HealthModule),
      },
    ]),
  ],
})
export class AdminRoutingModule {}
